  false,\n\t\"url\": null,\n\t\"notes\": \"This LiDAR data is within Illinois Department
  of Transportation districts 1 and 3 covering Grundy, Kane and McHenry counties.
  The data is updated from its original format to LAS version 1.2. The LiDAR data
  was collected in April 2008. Task Order Number: 3. Data was acquired by Quantum
  Spatial as project 1080208 with an Optech ALTM 3100 sensor equipped with an inertial
  measuring unit (IMU) and GPS receiver. The acquisition was to produce bare earth
  ASCII, LAS data and 2 foot contour Shapefiles. Only the counties of Grundy, McHenry
  and Kane were included in the Digital Coast project, as the other nine counties
  are not directly related to NOAA OCM tools and internal products.\",\n\t\"license_title\":
